  `periodo` int(11) DEFAULT NULL,
  `matricula` int(11) DEFAULT NULL,
  `laborados` int(11) DEFAULT NULL,
  `faltas` int(11) DEFAULT NULL,
  `justificadas` int(11) DEFAULT NULL,
  `observacion` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`codigoasis`),
  KEY `RELATIONSHIP_31_FK` (`matricula`),
  KEY `RELATIONSHIP_34_FK` (`periodo`),
  KEY `FK550EAF5ACC4EDE17` (`matricula`),
  KEY `FK550EAF5AA274C238` (`periodo`),
  CONSTRAINT `FK550EAF5AA274C238` FOREIGN KEY (`periodo`) REFERENCES `periodo` (`codigoper`),
  CONSTRAINT `FK550EAF5ACC4EDE17` FOREIGN KEY (`matricula`) REFERENCES `matriculas` (`codigomat`),
  CONSTRAINT `FK_asistencia` FOREIGN KEY (`matricula`) REFERENCES `matriculas` (`codigomat`),
  CONSTRAINT `FK_periodo` FOREIGN KEY (`periodo`) REFERENCES `periodo` (`codigoper`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

