/*Table structure for table `cursos` */

DROP TABLE IF EXISTS `cursos`;

CREATE TABLE `cursos` (
  `codigocur` int(11) NOT NULL,
  `periodo` int(11) DEFAULT NULL,
  `especialidad` int(11) DEFAULT NULL,
  `paralelo` int(11) DEFAULT NULL,
  `descripcion` varchar(100) DEFAULT NULL,
  `secuencia` int(11) DEFAULT NULL,
  `aprobacion` double DEFAULT '0',
  `minima` double DEFAULT NULL,
  `inspector` varchar(100) DEFAULT NULL,
  `cedulaiden` varchar(100) DEFAULT NULL,
  `tutor` varchar(100) DEFAULT NULL,
  `cedulatut` varchar(100) DEFAULT NULL,
  `inicial` date DEFAULT '2008-10-08',
  `finali` date DEFAULT '2008-10-08',
  PRIMARY KEY (`codigocur`),
  KEY `FK_ECTIVO` (`periodo`),
  KEY `FK_especialidad` (`especialidad`),
  KEY `FK_cursos` (`paralelo`),
  KEY `FKAF961357394D823` (`paralelo`),
  KEY `FKAF96135792E27CB9` (`especialidad`),
  KEY `FKAF961357A274C238` (`periodo`),
  CONSTRAINT `FK_cursos` FOREIGN KEY (`paralelo`) REFERENCES `global` (`codigo`),
  CONSTRAINT `FK_especialidad` FOREIGN KEY (`especialidad`) REFERENCES `global` (`codigo`),
  CONSTRAINT `FK_periodoss` FOREIGN KEY (`periodo`) REFERENCES `periodo` (`codigoper`)
