  CONSTRAINT `FK61D2A10478819F6F` FOREIGN KEY (`empleado`) REFERENCES `empleados` (`codigoemp`),
  CONSTRAINT `FK61D2A104A274C238` FOREIGN KEY (`periodo`) REFERENCES `periodo` (`codigoper`),
