/*Table structure for table `materiasgrado` */

DROP TABLE IF EXISTS `materiasgrado`;

CREATE TABLE `materiasgrado` (
  `codigo` int(11) NOT NULL,
  `curso` int(11) DEFAULT NULL,
  `profesor` int(11) DEFAULT NULL,
  `profesor2` int(11) DEFAULT NULL,
  `fechainicio` date DEFAULT NULL,
  `fechafin` date DEFAULT NULL,
  `notaini` double(8,4) DEFAULT NULL,
  `notafin` double(8,4) DEFAULT NULL,
  `nombre` varchar(100) DEFAULT NULL,
  `abreviatura` varchar(50) DEFAULT NULL,
  `formula` varchar(50) DEFAULT NULL,
  `espromedio` tinyint(1) DEFAULT NULL,
  `columna` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`codigo`),
  KEY `FK_gprofesor` (`profesor`),
  KEY `FK_gra_profe2` (`profesor2`),
  KEY `FK_gra_materias` (`curso`),
  CONSTRAINT `FK_materiasgradoCurso` FOREIGN KEY (`curso`) REFERENCES `cursos` (`codigocur`),
  CONSTRAINT `FK_materiasgradoEmpleados2` FOREIGN KEY (`profesor2`) REFERENCES `empleados` (`codigoemp`),
  CONSTRAINT `FK_materiasgradoProfesor` FOREIGN KEY (`profesor`) REFERENCES `empleados` (`codigoemp`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `materiasgrado` */

/*Table structure for table `matriculas` */

DROP TABLE IF EXISTS `matriculas`;

CREATE TABLE `matriculas` (
  `codigomat` int(11) NOT NULL,
  `numero` int(6) unsigned zerofill DEFAULT NULL,
  `folio` int(6) DEFAULT NULL,
  `estudiante` int(11) NOT NULL,
  `curso` int(11) DEFAULT NULL,
  `observacion` varchar(50) DEFAULT NULL,
  `institucion` varchar(60) DEFAULT NULL,
  `estado` varchar(15) DEFAULT NULL,
  `foto` blob,
  `fechamat` date DEFAULT NULL,
  `fecharet` date DEFAULT NULL,
  `fechains` date DEFAULT NULL,
  `beca` double(10,2) DEFAULT NULL,
  `otros` double(10,2) DEFAULT NULL,
  `jornada` varchar(2) DEFAULT NULL,
  `nuevo` tinyint(1) DEFAULT '0',
  `repite` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`codigomat`),
  KEY `FK_matriculas` (`estudiante`),
  KEY `FK_cursosss` (`curso`),
  KEY `FK8A98B2B5BD19D3D7` (`curso`),
  KEY `FK8A98B2B5DCD4494F` (`estudiante`),
  CONSTRAINT `FK8A98B2B5BD19D3D7` FOREIGN KEY (`curso`) REFERENCES `cursos` (`codigocur`),
  CONSTRAINT `FK8A98B2B5DCD4494F` FOREIGN KEY (`estudiante`) REFERENCES `estudiantes` (`codigoest`),
  CONSTRAINT `FK_cursosss` FOREIGN KEY (`curso`) REFERENCES `cursos` (`codigocur`),
  CONSTRAINT `FK_matriculas` FOREIGN KEY (`estudiante`) REFERENCES `estudiantes` (`codigoest`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

